import React, { useEffect, useState } from 'react';
import agent from '../api/agent';
import { useParams } from 'react-router-dom';
import ResponsiveAppBar from '../components/appbar';
import { Card, CardContent, CardMedia, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@mui/material';


export default function CourseDetails() {
  const { id } = useParams();
  const [courseDetails, setCourseDetails] = useState(null);
  const courseId = parseInt(id);
  const [trainers, setTrainers] = useState();

  useEffect(() => {
    agent.SpecialCourse.trainers()
      .then(trainers => setTrainers(trainers))
      .catch(error => console.error('Error fetching facilities:', error));
  }, []);

  useEffect(() => {
    agent.SpecialCourse.details(courseId)
      .then(details => {setCourseDetails(details);})
      .catch(error => console.error('Error fetching course details:', error.response));
  }, [id]);


  if (!courseDetails) {
    return <p>Loading...</p>;
  }
  const matchingTrainers = trainers.filter(trainer => trainer.trainerDescription === courseDetails.specialCourseName);


  return (
    <div>
        <ResponsiveAppBar/>
      <div style={{ width: '100%', height: '40vh', position: 'relative' }}>
        <img
          src={courseDetails?.specialCourseImgUrl}
          alt={courseDetails?.specialCourseName}
          style={{ width: '100%', height: '100%', objectFit: 'cover' }}
        />
        <div
          style={{
            position: 'absolute',
            bottom: 0,
            left: 0,
            padding: '5px',
            color: 'black',
            textTransform: 'uppercase',
            fontSize: '100px',
          }}
        >
          {courseDetails?.specialCourseName}
        </div>
      </div>
      <div style={{ marginTop: '20px' }}>
        <h2>Katılım Koşulları</h2>
        <p>{courseDetails?.specialCourseCondition}</p>
      </div>
      <div style={{ marginTop: '20px' }}>
        <h2>Antrenörler</h2>
        <TableContainer component={Paper}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Fotoğraf</TableCell>
                <TableCell>İsim</TableCell>
                <TableCell>Gün ve Saat</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {matchingTrainers.map((trainer) => (
                <TableRow key={trainer.id}>
                  <TableCell>
                    <Card>
                      <CardMedia
                        component="img"
                        height="140"
                        image={trainer.trainerImageUrl}
                        alt={trainer.trainerName}
                      />
                      <CardContent>
                        <Typography variant="h6">{trainer.trainerName}</Typography>
                      </CardContent>
                    </Card>
                  </TableCell>
                  <TableCell>{trainer.trainerName}</TableCell>
                  <TableCell>
                    <ul>
                      {trainer.daySchedules.map((schedule) => (
                        <li key={schedule.day}>
                          {`Day ${schedule.day}: ${schedule.startTime} - ${schedule.endTime}`}
                        </li>
                      ))}
                    </ul>
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </div>
    </div>
  );
}
